
(function() {
    // 模拟历史数据
    const mockHistory = [
        {
            id: 'mock1',
            date: new Date(Date.now() - 86400000).toISOString(), // 1天前，使用ISO格式
            image: 'data:image/jpeg;base64,',
            result: {
                prediction: 'clear sky',
                confidence: 0.75
            }
        },
        {
            id: 'mock2',
            date: new Date(Date.now() - 160000000).toISOString(), // 2天前，使用ISO格式
            image: 'data:image/jpeg;base64,',  // 这里需要有效的base64图像数据
            result: {
                prediction: 'filled balloon',
                confidence: 0.52
            }
        },
        {
            id: 'mock3',
            date: new Date(Date.now() - 145600000).toISOString(), // 2天前，使用ISO格式
            image: 'data:image/jpeg;base64,',
            result: {
                prediction: 'sliced pizza',
                confidence: 0.64
            }
        }
    ];

    // 强制清除并重新添加所有模拟数据
    function addMockHistory() {
        const historyKey = 'ocr_history';
        let existingHistory = localStorage.getItem(historyKey);
        let history = existingHistory ? JSON.parse(existingHistory) : [];
        
        // 先移除所有模拟数据
        history = history.filter(item => !item.id.startsWith('mock'));
        
        // 添加全部模拟数据
        history = [...mockHistory, ...history];
        
        // 保存回localStorage
        localStorage.setItem(historyKey, JSON.stringify(history));
        console.log('已添加模拟历史记录数据，共' + mockHistory.length + '条');
        
        // 如果历史记录管理器已初始化，刷新显示
        if (window.historyManager) {
            window.historyManager.loadHistory();
            console.log('已刷新历史记录显示');
        }
    }

    // 确保DOM已加载
    if (document.readyState === 'loading') {
        window.addEventListener('DOMContentLoaded', addMockHistory);
    } else {
        addMockHistory();
    }
})();